import React from 'react'
import { NavLink } from 'react-router-dom'

const Navbar = () => {
    return (
        <>
        div.con
            <NavLink exact to="/" >Home</NavLink>
            <NavLink exact to="/about" >About</NavLink>
        </>
    )
}

export default Navbar
